function oosHookJsCodeMailAlert(){$.ajax({type:'POST',url:"http://www.49ersfanstoreonline.com/module/mailalerts/actions?process=check",data:'id_product=2025&id_product_attribute='+$('#idCombination').val(),success:function(msg){if(msg=='0'){$('#mailalert_link').show();$('#oos_customer_email').show();}
else{$('#mailalert_link').hide();$('#oos_customer_email').hide();}}});}
function addNotification(){$.ajax({type:'POST',url:"http://www.49ersfanstoreonline.com/module/mailalerts/actions?process=add",data:'id_product=2025&id_product_attribute='+$('#idCombination').val()+'&customer_email='+$('#oos_customer_email').val()+'',success:function(msg){if(msg=='1'){$('#mailalert_link').hide();$('#oos_customer_email').hide();$('#oos_customer_email_result').html("Request notification registered");$('#oos_customer_email_result').css('color','green').show();}
else if(msg=='2'){$('#oos_customer_email_result').html("You already have an alert for this product");$('#oos_customer_email_result').css('color','red').show();}else{$('#oos_customer_email_result').html("Your e-mail address is invalid");$('#oos_customer_email_result').css('color','red').show();}}});return false;}
